import React from "react";
import styled from "styled-components";
const Nav = styled.nav`
    border: solid 2px #ffffff;
    color: #bc5a5a;

    box-shadow: 0px 0px 15px rgba(0, 0, 0, 0.3);

    font-size: 1.4rem;
`;
const Menu = () => {
    return (
        <Nav>
            <li>home</li>
            <li>Cotnact</li>
        </Nav>
    );
};

export default Menu;
